import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <nav className="navbar">
      <h1>Course Management App</h1>
      <Link to="/add-course" className="btn">Add Course</Link>
    </nav>
  );
};

export default NavBar;
